import React from 'react';


import { Brand, Feature, Navbar} from './components';
import { Footer, Features, Header} from './containers';

import './App.css';

const App = () => (
  <div className = "row">
    <div class="column">
      <Navbar />
    </div>
    {/* <div class = "column"> */}
    <div>
      <Header />
      <Brand />
      <Feature />
      <Features />
      <Footer />
    </div>
  </div>
  );

export default App;
